    {
        while (!UserSession.IsLoaded)
        {
            await Task.Delay(100);
        }

        if (!UserSession.IsSessionStarted)
        {
            NavigationManager.NavigateTo("/");
        }

        // анимируем всплывание контента
        await JsRuntime.InvokeVoidAsync("animateContent");
    }

